import React from 'react';
import { Link } from 'react-router-dom';
import translator from '../Translator/translator';
import Contents from './Contents';

function Layout(props) {
    return (
        <>
            <header>
                <h2>geomanagement2</h2>
            </header>

            <section>
                <div>


                    {/*  NAV  ******************************************* */}
                    <div>
                        <aside>
                            <ul>
                                <Link to="/countries">
                                    <li>
                                        {translator("countries")}
                                    </li>
                                </Link>
                                <Link to="/countries/new">
                                    <li>
                                        {translator("countriesNew")}
                                    </li>
                                </Link>

                                <Link to={{
                                    pathname: `/countries/:id/edit`,
                                }} >   <li>
                                        {translator("countriesEdit")}
                                    </li>
                                </Link>

                                <Link to="/provinces">
                                    <li>
                                        {translator("provinces")}
                                    </li>
                                </Link>

                                <Link to="/provinces/new">
                                    <li>
                                        {translator("provincesNew")}
                                    </li>
                                </Link>

                                <Link to={{
                                    pathname: `/provinces/${3}/edit`,
                                }} >   <li>
                                        {translator("provincesEdit")}
                                    </li>
                                </Link>

                                <Link to="/cities">
                                    <li>
                                        {translator("cities ")}
                                    </li>
                                </Link>

                                <Link to="/cities/new">
                                    <li>
                                        {translator("citiesNew ")}
                                    </li>
                                </Link>

                            </ul>
                        </aside>
                    </div>

                    {/*  CONTENT  ******************************************* */}

                    <div className="content">
                        <Contents />
                    </div>

                </div>
            </section>



            <footer>
                <p>Footer</p>
            </footer>
        </>
    );
}

export default Layout;
